def binary_search(list, a):
    low = 0
    high = len(list) - 1
    print("Длина списка - " + str(high))
    while low != high:
        midle = round((low + high) / 2) # ЭТО ТЕПЕРЬ ТОЧГО СЕРЕДИНА! round - это округление до целого числа  

        

        if a == list[midle]:
            print('YES!')
            return list[midle]
        elif a > list[midle]:
            low = midle
        else: high = midle
        print(f"Середина {low} and {high} = {midle}")
    return 'такого числа нет в списке!'

